    shed, build up a level parking area to the south end of the shed, and to grade
    a CFA compliant access path on the western side of the shed.\r\n\r\nThe works
    required a extension of the previous cut and scrap from the original build of
    the shed in the 1970s, and levelling works.\r\n\r\nThe total material moved was
    4 metres and all soils have been retained on the property.\r\n\r\nThe flat hard
    standing areas will be covered in a crushed rock and the track will have a gravel
    base to improve all weather traction, while not impeding water flow to adjacent
    plants and ground cover.\r\n\r\nAreas will be landscaped post earthworks. Open
    areas will be topsoiled and seeded with local grasses common to the Warrandyte
